import React from 'react';
import PRP from './Image.jpeg'
function PDP() {
    return (
      <div className="max-w-md mx-auto mt-8 p-6  rounded-md shadow-md text-center font-b">
        <h1 className="mt-12 text-4xl font-bold text-white">PERSONALISATION de votre profil</h1>
        <div> <img className='rounded-full w-48 ml-24 ' src={require('./Image.jpeg')} alt ="PRP image"/></div>
        <form className="mt-8">
          <div className="mb-4">
            <label htmlFor="email" className="block text-white text-2xl font-bold mb-2"> Nom du profil </label>
            <input type="email" id="email" name="email" className="w-full bg-transparent text-white rounded-full border-2 border-cyan-500 p-2 focus:outline-none"/>
          </div>
          </form>
          </div>
    );
};

export default PDP;
